BaseMvpActivity.class
@SuppressWarnings("unchecked")
public abstract class BaseMvpActivity extends BaseActivity implements IBaseView {
    protected P presenter;

    @Override
    protected void onCreate(@Nullable Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        //创建present
        presenter = createPresenter();
        if (presenter != null) {
            presenter.attachView(this);
        }
    }

    @Override
    protected void onDestroy() {
        super.onDestroy();
        if (presenter != null) {
            presenter.detachView();
            presenter = null;
        }

    }


    //***************************************IBaseView方法实现*************************************
    @Override
    public void showLoading() {
        if (loadingDialog != null && !loadingDialog.isShowing()) {
            loadingDialog.show();
        }
    }

    @Override
    public void dismissLoading() {
        if (loadingDialog != null && loadingDialog.isShowing()) {
            loadingDialog.dismiss();
        }
    }

    @Override
    public void onEmpty(Object tag) {

    }

    @Override
    public void onError(Object tag, String errorMsg) {

    }

    @Override
    public Context getContext() {
        return mContext;
    }
    //***************************************IBaseView方法实现*************************************

    /**
     * 创建Presenter
     */
    protected abstract P createPresenter();
}
BaseMvpAcitvity主要是往上封装了一层Mvp的基类，这里主要为了方便使用Mvp，Presenter作为可选参数引入，然后在基类中初始化，Mvp如何使用这里不做介绍啊，个人感觉MVP模式虽然将moudle、present和view分开，但是需要建很多类，解耦处理的很好，但是文件很多很复杂，不如原始MVC使用的方便。BaseMvpFragment跟BaseMvpActivity类似，不做解释。
