声明
本文章基于OkHttp基础进行开发，主要是仿IOS调试工具DBDebugToolkit的网络日志抓取功能，原理十分简单，对OkHttp设置拦截器，在拦截器中拦截请求数据和返回数据，然后存储到本地文件中，最后再从本地文件中读取相应的信息展示，方便开发人员和测试人员进行网络接口调试。
