流程示意图


用户打开你的app.

插件初始化，在后台进程启动 升级加载器（update loader）.

Update loader  从 config.xml 取 config-file 配置（一个url），并从此url加载一段 JSON 配置.  然后它把这段JSON配置中的 release 版本号 和当前app 已经安装的进行比较. 如果不同 - 进入下一步.

Update loader 使用app配置（application config）中的 content_url ，去加载清单文件（manifest）. 它会找出自上次升级以来，哪些文件需要更新.

Update loader 从 content_url下载更新文件.

如果一切顺利 - 发出一个"升级文件已经准备好，可以安装了"的通知.

升级文件已安装, app重新进入更新过的页面.


