var、let和const
let与var类似是用来声明变量的，const用来声明常量(ES5只有全局作用域和函数作用域，没有块级作用域)，const也用来声明变量，但是声明的是常量，一旦声明，常量的值就不能改变。它和let一样只在声明的区域内有用。
