es5中
function zpost(url,param,doPost){
    if(!url.startWith("http://"))
        url = getSite() + "/" + url;
    $.ajax({
        type: 'POST',
        url: url,
        data: param,
        dataType: 'html',
        timeout: 30000,
        success: function(data){
            doPost(data);
        },
