yarn add babel-core@6.26.0 babel-loader@7.1.2 babel-preset-env@1.6.1 --dev
并将webpack.config.js文件，rules修改为以下内容
module: {
    rules: [
      {
        test: /\.m?jsx$/,
        exclude: /(node_modules)/,
        use: {
          loader: "babel-loader",
          options: {
            presets: ["env", "react"]//将它修改为env使用低版本
          }
        }
      }
    ]
  }
在运行就会发现已经打包成功，用浏览器打开就会发现内容修改为Hello Webpack

.babelsrc文件配置
可以参考网址：https://excaliburhan.com/post/babel-preset-and-plugins.html
安装使用css-loader和style-loader
该loader用来解析样式文件，css-loader官网网址：https://webpack.js.org/loaders/css-loader/#root，style-loader官网网址：https://webpack.js.org/loaders/style-loader/#root
安装
yarn add css-loader style-loader --dev
安装完成之后配置webpack.config.js文件
webpack.config.js
module: {
    rules: [
      {
        test: /\.m?jsx$/,
        exclude: /(node_modules)/,
        use: {
          loader: "babel-loader",
          options: {
            presets: ["env", "react"]
          }
        }
      },
      {//添加如下配置
        test: /\.css$/,
        use: ['style-loader', 'css-loader'],
      }
    ]
  }
在目录添加css目录，并创建index.css文件

在index.css添加代码
#root{
    color: red;
}
注意：此时运行webpack，发现样式并不会生效，此时需要在.jsx文件中引入样式文件
运行webpack,查看样式变化，文字变红
index.jsx
import React from 'react';
import ReactDOM from 'react-dom';
import '../css/index.css';//加入这一行

ReactDOM.render(
  Hello, Webpack!,
  document.getElementById('root')
);
css样式加载优化处理（使用ExtractTextWebpackPlugin）
如果这种方式引入，你会发现dist文件下，并没有样式文件，在index.js搜索发现如下代码
index.js
exports.push([module.i, "#root{\n    color: red;\n}", ""]);
根据html解析顺序的话，css需要等待所有的js代码加载完成才会进行样式加载，这样页面会有很大的一段白屏时间，接下来进行css样式加载优化处理。链接网址：https://blog.csdn.net/qq_39793127/article/details/78900707
安装ExtractTextWebpackPlugin
yarn add extract-text-webpack-plugin --dev
使用ExtractTextWebpackPlugin
在webpack.config.js配置文件中引入该插件，并将css文件的打包方式改为ExtractTextWebpackPlugin插件的方式
webpack.config.js
const path = require("path");
var HtmlWebpackPlugin = require("html-webpack-plugin");
const ExtractTextPlugin = require("extract-text-webpack-plugin");

module.exports = {
  mode: "none",
  entry: "./src/js/index.jsx",
  output: {
    path: path.resolve(__dirname, "dist"),
    filename: "index.js"
  },
  module: {
    rules: [
      ...//由于引入太多使用省略号隐藏
      {
        test: /\.css$/,
        use: ExtractTextPlugin.extract({
          fallback: "style-loader",
          use: "css-loader"
        })
      }
    ]
  },
  plugins: [
    ...//由于引入太多使用省略号隐藏
    new ExtractTextPlugin("index.css")
  ]
};
运行webpack报错，错误如下，百度可知，插件当前版本不支持webpack4，使用beta版本可解决该问题
解决方法，安装beta 版本
yarn add extract-text-webpack-plugin@next --dev
再次运行webpack，执行成功，dist下增加index.css文件
打包Sass样式文件(sass-loader)
现在进行sass文件进行打包，链接地址：https://webpack.js.org/plugins/extract-text-webpack-plugin/#extracting-sass-or-less
安装sass-loader
yarn add sass-loader node-sass --dev
注意，sass-loader以来node-sass和webpack，使用sass-loader必须安装另外两个
在webpack.config.js配置rules规则，依旧使用ExtractTextWebpackPlugin处理
webpack.config.js
{
        test: /\.scss$/,
        use: ExtractTextPlugin.extract({
          fallback: "style-loader",
          use: ["css-loader", "sass-loader"]
        })
      }
新建index.scss文件，并更改样式文件，将背景更改为灰色，并将字体变成30px大小
index.scss
body{
    background: gray;
    #root{
        font-size: 30px;
    }
}
在index.jsx文件中引入index.scss样式文件
index.jsx
import React from 'react';
import ReactDOM from 'react-dom';
import '../css/index.css';
import '../css/index.scss';//添加这一行代码

ReactDOM.render(
  Hello, Webpack!,
