运行webpack之后发现dist目录下的index.css文件改变，在网页打开发现网页北京变成灰色，字体变大
index.css
#root{
    color: red;
}
body {
    background: gray; 
}
body #root {
    font-size: 30px; 
}

安装使用资源处理(file-loader和url-loader)
本文用file-loader的封装url-loader，url-loader类似于file-loader，但如果文件小于字节限制，则可以返回DataURL,file-loader官网链接：https://webpack.js.org/loaders/file-loader/#root，url_loader官网链接：https://webpack.js.org/loaders/url-loader/#root
安装url-loader
yarn add file-loader url-loader --dev
//npm install url-loader --save-dev
注意：url-loader依赖于file-loader,所以file-loader也需要安装
使用url-loader
配置webpack.config.js文件，在rules添加url-loader配置
webpack.config.js
{
        test: /\.(png|jpg|gif)$/i,
        use: [
          {
            loader: 'url-loader',
            options: {
              limit: 8192
            }
          }
        ]
      }
test表示匹配的后缀名，loader表示使用url-loader，option中的limit表示大于8k生成图片，小于8k生成DataURL，这里自己照一张图片放入项目的image目录下，执行webpack会发现dist目录下多了一张打包的图片，修改index.scss的背景样式，在浏览器查看效果
body{
    background: url(../image/test.jpg);
    background-size: 100%;
    #root{
        font-size: 30px;
    }
}

使用字体文件font-awesome()
文字文件使用font-awesome，font-awesome官网地址：http://www.fontawesome.com.cn/faicons/
安装font-awesome字体文件
yarn add font-awesome
使用font-awesome
在index.jsx文件中编写，引入font-awesome里面的css文件，并在标签上加入className属性，放入fontawesome的样式
index.jsx
import React from "react";
import ReactDOM from "react-dom";
import "../css/index.css";
import "../css/index.scss";
import "font-awesome/css/font-awesome.min.css";//此处为添加代码

ReactDOM.render(

    //此处为添加代码
    Hello, Webpack!
  ,
  document.getElementById("root")
);
这时候运行webpack会如下错误，原因是打包配置里面没有配置这些类型文件的解析，接下来我们直接用url-loader在rules中来进行字体文件的配置

webpack.config.js
{
        //font-awesome字体文件处理
        test: /\.(eot|svg|ttf|woff|woff2)$/,
        use: [
          {
            loader: "url-loader",
            options: {
              limit: 8192
            }
          }
        ]
      }
这样运行之后会发现dist目录下增加了字体文件，在浏览器中打开就可以看到效果
