使用webpack-dev-server
webpack-dev-server为您提供了一个简单的Web服务器和使用实时重新加载的能力。
安装webpack-dev-server
yarn global add webpack-dev-server --dev
//安装成功之后运行命令
webpack-dev-server//运行之后在浏览器打开localhost:8080查看
打开之后发现图片和字体文件找不到，在output中添加pubicPath属性，这个属性表示将index.html引入的css和资源文件都加上dist这层目录，相当于绝对路径引入，打包之后访问localhost:8080/dist/index.html,现在就可以直接访问该网页了，然后修改样式或者内容，网页会自动重新加载。
webpack.config.js
output: {
    path: path.resolve(__dirname, "dist"),
    publicPath: "/dist/",
    filename: "js/index.js"
  }
  ...
  devServer: {
      port:8086,
      contentBase: './dist'//这个跟publicPath属性是一样的作用
  }
